import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import styles from './truckAdd.module.css';


const TruckAdd = () => {
  return (
    <div className="">            
      <Box sx={{ height: 150, width: '100%' }}>
        <h3>Add Truck</h3>
        <Box className={styles.textInputBox} sx={{ width: '100'}}>

          <TextField sx={{margin: '10px'}} id="outlined-basic" label="Licence Plate" variant="outlined" />            
          <TextField sx={{margin: '10px'}} id="outlined-basic" label="Name" variant="outlined" />

        </Box>

      </Box>
    </div>
  );
};

export default TruckAdd;
